  nameWithType: Multiset.Entry<E>.equals(Object o)
  summary: |2-


     <p>Returns <code>true</code> if the given object is also a multiset entry and the two entries
     represent the same element and count. That is, two entries <code>a</code> and <code>b</code> are equal
     if:

     <pre><code>
     Objects.equal(a.getElement(), b.getElement())
         && a.getCount() == b.getCount()
     </code></pre>
